import React, { useState } from "react";
import '../design/cliente.css';

function Cliente() {

   const [firstName, setFirstName] = useState("");
   const [idUsina, setIdUsina] = useState("");
   const [percParticipacao, setpercParticipacao] = useState("");

   return (
      <div className="App">
         <header>
            <div className="appbar">
               <ul className='ul'>
                  <li><a href="/">Gráfico</a></li>
                  <li><a href="/lista">Lista de Clientes</a></li>
               </ul>
            </div>
         </header>
         <main className="Main">
            <div className="cadastro">
               <h1>Cadastro de Novos Clientes</h1>
               <form className="formulario" >
                  <label className="info">Nome:</label>
                  <input
                     type="text"
                     className="entrada"
                     value={firstName}
                     onChange={e => setFirstName(e.target.value)}
                  />
                  <label className="info">ID Usina:</label>
                  <input
                     type="text"
                     className="entrada"
                     value={idUsina}
                     onChange={e => setIdUsina(e.target.value)}
                  />
                  <label className="info">Percentual de paticipação: </label>
                  <input
                     type="text"
                     className="entrada"
                     value={percParticipacao}
                     onChange={e => setpercParticipacao(e.target.value)} />
                  <button className="botao" >Salvar</button>
               </form>
            </div>
            <div className="Lista">
               
            </div>
         </main>
      </div>
      
   )

}
export default Cliente;
